import "./HeroImage2.css"

import React from 'react'

class HeroImage2 extends Component {
    render(){
        return (
            <div className="hero-img">
                <div className="heading">
                    <h1>{this.props.heading}</h1>
                    <p>{this.props.text}</p>
                </div>
            </div>
          )
        }
}

export default HeroImage2
